// pages/layout/notice/modal1/modal1.js
const app = getApp();
Page({

  data: {
    notices: [],
    vote: [],
    newnotice_jpg: "data:image/jpg;base64,"
  },
  gotoNoticeDetail: function (options) {
    console.log(options)
    if (this.data.userType == 0) { //student
      wx.request({
        url: "https://www.ningziqian.work:8000/notice_single_user/",
        method: "POST",
        data: {
          user_no: app.globalData.userinfo['username'],
          notice_no: options.currentTarget.dataset['noticeid']
        },
        // 服务器返回信息，将信息存储至本地缓存
        success: function (res) {
          app.globalData.notice_detail = res['data']
          console.log(app.globalData.notice_detail)
          wx.navigateTo({
            url: '/pages/group/notice/notice_detail/notice_detail'
          })
        },
        fail: function (res) {
          console.log('submit fail');
        },
      })
    } else { //admin
      wx.request({
        url: "https://www.ningziqian.work:8000/notice_all_user/",
        method: "POST",
        data: {
          notice_no: options.currentTarget.dataset['noticeid']
        },
        // 服务器返回信息，将信息存储至本地缓存
        success: function (res) {
          app.globalData.notice_detail = res['data']
          console.log(app.globalData.notice_detail)
          wx.navigateTo({
            url: '/pages/group/notice/notice_detail/notice_detail'
          })
        },
        fail: function (res) {
          console.log('submit fail');
        },
      })
    }

  },

  onLoad: function (options) {
    console.log(options)
    if (app.globalData.userinfo['type'] === "admin") {
      this.setData({
        userType: 1,
      })
    } else {
      this.setData({
        userType: 0,
      })
    }

    this.setData({
      groupName: JSON.parse(options.groupName),
      groupID: JSON.parse(options.groupID),
      notices: app.globalData.notices
    })
    console.log(this.data.notices)
  },

  onShow: function (options) {
    this.setData({
      notices: app.globalData.notices
    })
  },

  gotoNoticeSend: function (options) {
    wx.navigateTo({
      url: '/pages/group/notice/notice_send/notice_send?groupID=' + JSON.stringify(this.data.groupID) + '&groupName=' + JSON.stringify(this.data.groupName)
    })
  },
})